import React from 'react'

import {
    Button, Container, Menu, Responsive, Segment,
    Visibility, Grid, Divider, Image, Header, Search, Icon, Dropdown, Label
}
    from 'semantic-ui-react'

import _HeaderMovieCast from './_HeaderMovieCast';
import imax from '../../Static/Images/imax.png';
import premiere from '../../Static/Images/premiere.png';
import lumiere from '../../Static/Images/lumiere.png';
import dreamers from '../../Static/Images/dreamers.png';
import shaw from '../../Static/Images/shaw.png'


const _NavigationItems = () =>{

return (
    <React.Fragment>
        <Grid.Row>
            <Grid.Column padded width={6} verticalAlign='middle'>
                <Grid columns='equal'>
                    <Grid.Column>
                        <Image inline src={shaw} fluid style={{ minHeight: 30, maxHeight: 30 }} />
                    </Grid.Column>
                    <Grid.Column>
                        <Image inline src={shaw} fluid style={{ minHeight: 30, maxHeight: 30 }} />
                    </Grid.Column>
                    <Grid.Column>
                        <Image inline src={shaw} fluid style={{ minHeight: 35, maxHeight: 35 }} />
                    </Grid.Column>
                    <Grid.Column>
                        <Image inline src={shaw} fluid style={{ minHeight: 30, maxHeight: 30 }} />
                    </Grid.Column>
                </Grid>
            </Grid.Column>
            <Grid.Column width={10} >
                <_HeaderMovieCast />
            </Grid.Column>
        </Grid.Row>
    </React.Fragment>
)
}

export default _NavigationItems;
